import React from 'react';
import { motion } from 'framer-motion';

// Icons for technologies
import { FaReact, FaNodeJs, FaJs, FaDatabase, FaGitAlt } from 'react-icons/fa';
import { SiTypescript, SiNextdotjs, SiExpress, SiMongodb, SiPostgresql, SiGraphql, SiTailwindcss, SiRedux, SiDocker, SiGithub, SiFigma, SiAdobexd } from 'react-icons/si';

const TechStack = () => {
  const techCategories = [
    {
      category: 'Frontend',
      skills: [
        { name: 'React', icon: <FaReact className="w-8 h-8" />, level: 90 },
        { name: 'Next.js', icon: <SiNextdotjs className="w-8 h-8" />, level: 85 },
        { name: 'JavaScript', icon: <FaJs className="w-8 h-8 text-yellow-400" />, level: 90 },
        { name: 'TypeScript', icon: <SiTypescript className="w-8 h-8 text-blue-600" />, level: 85 },
        { name: 'Tailwind CSS', icon: <SiTailwindcss className="w-8 h-8 text-cyan-500" />, level: 90 },
        { name: 'Redux', icon: <SiRedux className="w-8 h-8 text-purple-600" />, level: 80 },
      ]
    },
    {
      category: 'Backend',
      skills: [
        { name: 'Node.js', icon: <FaNodeJs className="w-8 h-8 text-green-600" />, level: 85 },
        { name: 'Express', icon: <SiExpress className="w-8 h-8" />, level: 85 },
        { name: 'MongoDB', icon: <SiMongodb className="w-8 h-8 text-green-600" />, level: 80 },
        { name: 'PostgreSQL', icon: <SiPostgresql className="w-8 h-8 text-blue-700" />, level: 75 },
        { name: 'GraphQL', icon: <SiGraphql className="w-8 h-8 text-pink-600" />, level: 75 },
        { name: 'Docker', icon: <SiDocker className="w-8 h-8 text-blue-500" />, level: 70 },
      ]
    },
    {
      category: 'Tools & Design',
      skills: [
        { name: 'Git', icon: <FaGitAlt className="w-8 h-8 text-orange-600" />, level: 85 },
        { name: 'GitHub', icon: <SiGithub className="w-8 h-8" />, level: 85 },
        { name: 'Figma', icon: <SiFigma className="w-8 h-8 text-purple-600" />, level: 75 },
        { name: 'Adobe XD', icon: <SiAdobexd className="w-8 h-8 text-pink-600" />, level: 70 },
      ]
    }
  ];

  return (
    <section id="skills" className="py-20 bg-paper-100 relative overflow-hidden">
      {/* Decorative elements */}
      <div className="absolute inset-0 overflow-hidden opacity-10">
        <div className="absolute -top-32 left-1/2 -translate-x-1/2 w-64 h-64 bg-golden-300 rounded-full mix-blend-multiply filter blur-xl opacity-20"></div>
        <div className="absolute bottom-0 right-0 w-96 h-96 bg-red-300 rounded-full mix-blend-multiply filter blur-xl opacity-20"></div>
      </div>

      <div className="container mx-auto px-4 pt-20 relative z-10">
        <div className="text-center mb-16">
          <h2 className="text-4xl md:text-5xl font-bold mb-4 text-gray-800">
            Skills & Technologies
          </h2>
          <div className="w-24 h-1 bg-gradient-to-r from-golden-500 to-red-400 mx-auto rounded-full"></div>
          <p className="mt-6 text-lg text-gray-600 max-w-2xl mx-auto">
            Here are the technologies and tools I work with on a regular basis.
          </p>
        </div>

        <div className="grid grid-cols-1 lg:grid-cols-3 gap-8 max-w-6xl mx-auto">
          {techCategories.map((category, catIndex) => (
            <motion.div 
              key={catIndex}
              className="glass-card p-8 rounded-2xl"
              initial={{ opacity: 0, y: 20 }}
              whileInView={{ opacity: 1, y: 0 }}
              viewport={{ once: true, margin: "-100px" }}
              transition={{ duration: 0.5, delay: catIndex * 0.1 }}
            >
              <h3 className="text-2xl font-bold text-gray-800 mb-6 flex items-center">
                <span className="w-2 h-8 bg-gradient-to-b from-golden-500 to-red-400 rounded-full mr-3"></span>
                {category.category}
              </h3>

              <div className="space-y-6">
                {category.skills.map((skill, skillIndex) => (
                  <div key={skillIndex} className="group">
                    <div className="flex items-center justify-between mb-1">
                      <div className="flex items-center space-x-3">
                        <div className="w-10 h-10 rounded-lg bg-white/80 flex items-center justify-center shadow-sm group-hover:shadow-md transition-shadow">
                          {skill.icon}
                        </div>
                        <span className="font-medium text-gray-800">{skill.name}</span>
                      </div>
                      <span className="text-sm font-medium text-golden-700">{skill.level}%</span>
                    </div>
                    <div className="w-full bg-gray-200 rounded-full h-2">
                      <motion.div 
                        className="h-full rounded-full bg-gradient-to-r from-golden-400 to-red-400"
                        initial={{ width: 0 }}
                        whileInView={{ width: `${skill.level}%` }}
                        viewport={{ once: true }}
                        transition={{ duration: 1, delay: 0.3 + (catIndex * 0.1) + (skillIndex * 0.05) }}
                      />
                    </div>
                  </div>
                ))}
              </div>
            </motion.div>
          ))}
        </div>
      </div>

      {/* Back to top link */}
      <div className="fixed right-10 top-1/2 transform -translate-y-1/2 rotate-90 origin-right text-sm text-gray-500 hover:text-gray-800 transition-colors z-50">
        <a href="#" className="flex items-center">
          BACK TO TOP
        </a>
      </div>
    </section>
  );
};

export default TechStack;
